import React from "react";
import { Link } from "react-router-dom";
import styles from "./Nav.module.css";

export function Li(props) {
  const { to, icon } = props;
  if (!icon) {
    return (
      <li>
        <Link to={to} className={styles.btn}>
          {props.children}
        </Link>
      </li>
    );
  }

  return <li></li>;
}

function Nav() {
  return <div>Nav</div>;
}

export default Nav;
